import React, {Component, useState, useEffect} from 'react'

function List(){

  const mylist = [
    {id: 1 , nome: 'Kaio Nunes', equipe: 'Wilson', mandinga: 'Cubo Magico', boa: false},
    {id: 1 , nome: 'Chico Picole', equipe: 'Wilson', mandinga: 'Picole', boa: false},
    {id: 1 , nome: 'Magaiver Brasileiro', equipe: 'Wilson', mandinga: 'Cubo Magico', boa: false},
  ]


  return(
    <div>
      <ul>
      { mylist.map( obj => (
       <li>id: {obj.id} nome: {obj.nome}</li> 
      ))}
      </ul>
    </div>
  )
}


export default List
